import * as React from 'react';
import Box from '@mui/material/Box';
import IconButton from '@mui/material/IconButton';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import InputAdornment from '@mui/material/InputAdornment';
import FormControl from '@mui/material/FormControl';
import TextField from '@mui/material/TextField';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import LockIcon from '@mui/icons-material/Lock';
import { Typography,Button } from '@mui/material';

export default function InputAdornments() {
  const [showPassword, setShowPassword] = React.useState(false);

  const handleClickShowPassword = () => setShowPassword((show) => !show);

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };

  return (
      <div>
        <Box sx={{ display:'flex', justifyContent:'center',alignContent:'center'}}>
            <LockIcon sx={{fontSize:'30px', borderRadius:'50%', backgroundColor:'rgb(215, 71, 66)', padding:'12px'}}></LockIcon>
        </Box>
        <Typography sx={{ color:'#fff', textAlign:'center', marginTop:'5px',marginBottom:'8px',fontSize:'20px'}}>
                Log In
        </Typography>

        <Box sx={{ display:'flex', flexDirection:'column',}}>
            <TextField
                helperText=" "
                id="demo-helper-text-aligned-no-helper"
                label="User name"
            />
            <FormControl variant="outlined">
            <InputLabel htmlFor="outlined-adornment-password">Password</InputLabel>
            <OutlinedInput
                id="outlined-adornment-password"
                type={showPassword ? 'text' : 'password'}
                endAdornment={
                <InputAdornment position="end">
                    <IconButton
                    aria-label="toggle password visibility"
                    onClick={handleClickShowPassword}
                    onMouseDown={handleMouseDownPassword}
                    edge="end"
                    >
                    {showPassword ? <VisibilityOff /> : <Visibility />}
                    </IconButton>
                </InputAdornment>
                }
                label="Password"
            />
            </FormControl>
            <Button variant="contained" sx={{ marginTop: '25px',marginBottom: '25px',backgroundColor:'rgb(215, 71, 66)'}}>Sign In</Button>
        </Box>
        <Box>
        <Button variant="text" sx={{ backgroundColor: 'po'}}>Text</Button>
        </Box>
      </div>
  );
}
